function Form({handleFirst, handleSecond, handleSubmit}){
return(
    <form onSubmit={handleSubmit}>
        <input type = "text"
        onChange={handleFirst}
        ></input>
        <input type = "text"
        onChange={handleSecond}
        ></input>
        <button>Click</button>
        <h1></h1>
    </form>
)
}
export default Form
